app.controller("accountController",["$scope","accountFactory",(s,r)=>{$("#resetPaswordForm").form({on:"blur",fields:{password:{identifier:"password",rules:[{type:"empty",prompt:"Please enter a valid password"}]},passwordConfirm:{identifier:"passwordConfirm",rules:[{type:"match[password]",prompt:"Mismatched Password"}]}},onSuccess:()=>{s.resetPassword()}}),s.resetPassword=(()=>{r.resetPassword(s.resetPasswordData).then(s=>{console.log(s)})})}]);